      funcEnd();
      return;
    }
    localStorage.setItem("TZ_RESERVE", new Date().getTime());

    TZLOG(logParam, (data) => {
      log(data);
      setTimeout(funcSearch, 1000);
    });
  }

funcSearch:
  function funcSearch() {
    log("funcReserve");

    const els = document.gcn("bline_btn");
    const dictCourse = {
      동코스: "East",
    };
    const result = [];
    Array.from(els).forEach((el) => {
      const elCompany = param1.attr("data-corpcode");
      if(elCompany != "02") return;
      
      const param = el.attr("onclick").inparen();
      const elDate = param[1];
      const elTime = param[2];
      console.log("reserve search", elDate, elTime);
      result.push({ date: elDate, time: elTime, course: "East" });
    });
    const param = {
      golf_club_id: "84962a8c-ef9c-11ec-a93e-0242ac11000a",
      device_id: "${deviceId}",
      result,
    };
    const addr = OUTER_ADDR_HEADER + "/api/reservation/newReserveSearch";
    post(addr, param, { "Content-Type": "application/json" }, (data) => {
      log(data);
      LOGOUT();
    });
  }
